DROP TABLE IF EXISTS commander;
DROP TABLE IF EXISTS adresse;
DROP TABLE IF EXISTS produit;
DROP TABLE IF EXISTS client;

START TRANSACTION;

CREATE TABLE `client` (
                          `id` int(11) NOT NULL AUTO_INCREMENT,
                          `nom` varchar(255) NOT NULL,
                          `prenom` varchar(255) NOT NULL,
                          `email` varchar(255) NOT NULL,
                          `telephone` varchar(13) NOT NULL,
                          `createdAt` datetime NOT NULL DEFAULT current_timestamp(),
                          PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: produit
#

CREATE TABLE `produit` (
                           `id` int(11) NOT NULL AUTO_INCREMENT,
                           `nom` varchar(200) NOT NULL,
                           `description` text NOT NULL,
                           `prix` int(11) NOT NULL,
                           PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=latin1;


CREATE TABLE `commander` (
                             `idProduit` int(11) NOT NULL,
                             `idClient` int(11) NOT NULL,
                             `date` datetime NOT NULL DEFAULT current_timestamp(),
                             PRIMARY KEY (`idProduit`,`idClient`, `date`),
                             CONSTRAINT `fk_idClient` FOREIGN KEY (`idClient`) REFERENCES `client` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
                             CONSTRAINT `fk_idProduit` FOREIGN KEY (`idProduit`) REFERENCES `produit` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: adresse
#

CREATE TABLE `adresse` (
                           `id` int(11) NOT NULL AUTO_INCREMENT,
                           `nom` varchar(255) NOT NULL,
                           `rue` text NOT NULL,
                           `codePostal` varchar(10) NOT NULL,
                           `ville` varchar(100) NOT NULL,
                           `clientId` int(11) NOT NULL,
                           PRIMARY KEY (`id`),
                           KEY `fk_clientId_adresse` (`clientId`),
                           CONSTRAINT `fk_clientId_adresse` FOREIGN KEY (`clientId`) REFERENCES `client` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=latin1;


COMMIT;